import React from 'react';

function Sponsors() {
  const sponsors = [
    { name: 'Dr. Andy Wang', img: '/assets/andywang.jpg', title: 'Professor & Director, MRTL' },
    { name: 'Sethuprasad Gorantla', img: '/assets/seth.jpg', title: 'Program Assistant Manager, MRTL' },
  ];

  return (
    <section className="section-sponsors">
      <h2>Our Sponsors</h2>
      <div className="sponsor-cards">
        {sponsors.map((sponsor, index) => (
          <div key={index} className="sponsor-card">
            <img src={sponsor.img} alt={`${sponsor.name}'s profile`} className="sponsor-img" />
            <h3>{sponsor.name}</h3>
            <p>{sponsor.title}</p>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Sponsors;
